import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import "./App.css";
import ButtonAdd from "./components/ButtonAdd";

class App extends Component {
  render() {
    return (
      <Router>
        <div className="App">
          <ButtonAdd />
        </div>
      </Router>
    );
  }
}

export default App;
